import * as React from 'react'
import { SelectBox } from '../../common/components/dropDownMenu/SelectBox'
export const Settings = () => {
    const settingOptions = [
        {label: 'Logout', value: 'logout'}
    ]
    return(
        <SelectBox title='Settings' options={settingOptions} />
    )
}
